import "./App.css";
import { Route, Routes } from "react-router-dom";
import Home from '../src/pages/Routes/Home';
import About from "./pages/Routes/About";

export default function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/About" element={<About/>}/>
      </Routes>
    </div>
  );
}
